Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Hyperlink\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Hashtag\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Unresolved Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Link\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; background: white; mso-fareast-language: EN-GB;\">A melodic, guitar-driven indie rock outfit from North London,&nbsp;</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\"><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;emerged to critic and fan buzz with their 2009 debut,&nbsp;</span><a href=\"https://www.allmusic.com/album/i-had-the-blues-but-i-shook-them-loose-mw0000823467\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">I Had the Blues But I Shook Them Loose</span></a><span style=\"background: white;\">. Blending together sensual, reverb-slicked post-punk sensibilities with the kind of bubbly, rhythmically adventurous quirkiness that evoked acts like&nbsp;</span><a href=\"https://www.allmusic.com/artist/orange-juice-mn0000478426\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Orange Juice</span></a><span style=\"background: white;\">,&nbsp;</span><a href=\"https://www.allmusic.com/artist/bloc-party-mn0000223861\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bloc Party</span></a><span style=\"background: white;\">, and&nbsp;</span><a href=\"https://www.allmusic.com/artist/vampire-weekend-mn0000662416\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Vampire Weekend</span></a><span style=\"background: white;\">,&nbsp;</span><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;have remained critics\' darlings. They\'ve also continued to grow, exploring electronic and dance influences on 2011\'s&nbsp;</span><a href=\"https://www.allmusic.com/album/a-different-kind-of-fix-mw0002176740\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">A Different Kind of Fix</span></a><span style=\"background: white;\">&nbsp;as well as world influences on 2014\'s&nbsp;</span><a href=\"https://www.allmusic.com/album/so-long-see-you-tomorrow-mw0002605687\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">So Long, See You Tomorrow</span></a><span style=\"background: white;\">.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 12.0pt 0cm 12.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\">Comprised of singer/guitarist&nbsp;<a href=\"https://www.allmusic.com/artist/jack-steadman-mn0002111109\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Jack Steadman</span></a>, guitarist&nbsp;<a href=\"https://www.allmusic.com/artist/jamie-maccoll-mn0002409504\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Jamie MacColl</span></a>, drummer&nbsp;<a href=\"https://www.allmusic.com/artist/suren-de-saram-mn0002409415\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Suren de Saram</span></a>, and bassist&nbsp;<a href=\"https://www.allmusic.com/artist/ed-nash-mn0002521551\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Ed Nash</span></a>,&nbsp;<a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a>&nbsp;initially came together in Crouch End in 2005 while&nbsp;<a href=\"https://www.allmusic.com/artist/steadman-mn0002111109\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Steadman</span></a>,&nbsp;<a href=\"https://www.allmusic.com/artist/maccoll-mn0002409504\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">MacColl</span></a>, and&nbsp;<a href=\"https://www.allmusic.com/artist/saram-mn0002409415\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Saram</span></a>&nbsp;were all students at University College School (attending at the same time as members of&nbsp;<a href=\"https://www.allmusic.com/artist/cajun-dance-party-mn0002078236\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Cajun Dance Party</span></a>). Initially calling themselves the Canals, they adopted different names over the course of the next year until&nbsp;<a href=\"https://www.allmusic.com/artist/nash-mn0002521551\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Nash</span></a>&nbsp;was brought on board in 2006, at which point the fledgling group dubbed themselves&nbsp;<a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a>&nbsp;in reference to an Indian restaurant chain. They entered Virgin Mobile\'s \"Road to V\" battle-of-the-bands contest soon after, a move that would effectively launch them out of obscurity and into the spotlight as one of that year\'s most hyped indie acts in Britain. They ended up winning the competition -- which in previous years had been won by the likes of&nbsp;<a href=\"https://www.allmusic.com/artist/young-knives-mn0000553317\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Young Knives</span></a>&nbsp;-- and were given a spot opening up V Festival that August.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 12.0pt 0cm 12.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\">A flurry of offers from several big labels came in, but&nbsp;<a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a>&nbsp;opted to self-release their first disc on their homegrown label, Mmm.... Produced by&nbsp;<a href=\"https://www.allmusic.com/artist/jim-abiss-mn0002416119\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Jim Abiss</span></a>&nbsp;(who\'d previously worked with&nbsp;<a href=\"https://www.allmusic.com/artist/the-arctic-monkeys-mn0000325357\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">the Arctic Monkeys</span></a>),&nbsp;<a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a>\'s debut EP,&nbsp;<a href=\"https://www.allmusic.com/album/the-boy-i-used-to-be-mw0002080507\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">The Boy I Used to Be</span></a>, was released in February 2007; the disc was given a warm critical reception, notably from the folks at NME. Another EP,&nbsp;<a href=\"https://www.allmusic.com/album/how-we-are-mw0001913782\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">How We Are</span></a>, was released that October, debuting in the number two spot on the U.K. indie singles chart. The bandmembers graduated upper secondary school the following June, and the rest of their summer was dominated by the release of a new single, \"Evening/Morning\" (released on the Young and Lost Club label), and a flurry of U.K. tour dates. Teaming up once again with&nbsp;<a href=\"https://www.allmusic.com/artist/abiss-mn0002416119\"><span style=\"color: black; mso-themecolor: text1; text-decoration: none; text-underline: none;\">Abiss</span></a>, they recorded their debut album at Konk Studios that fall.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\"><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;signed with Island Records as 2008 came to a close; their debut full-length on the label,&nbsp;</span><a href=\"https://www.allmusic.com/album/i-had-the-blues-but-i-shook-them-loose-mw0000823467\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">I Had the Blues But I Shook Them Loose</span></a><span style=\"background: white;\">, was released the following summer. The album was well received and helped to win them the Best New Band award at the 2010 NME Awards. In July 2010,&nbsp;</span><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;released their sophomore effort,&nbsp;</span><a href=\"https://www.allmusic.com/album/flaws-mw0002003301\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Flaws</span></a><span style=\"background: white;\">, which found the bandmates unplugging their instruments and recording acoustic songs, including a cover of&nbsp;</span><a href=\"https://www.allmusic.com/artist/joanna-newsom-mn0000784811\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Joanna Newsom</span></a><span style=\"background: white;\">\'s \"Swansea.\" The following year, they returned to a fully electric sound with the release of the&nbsp;</span><a href=\"https://www.allmusic.com/artist/abiss-mn0002416119\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Abiss</span></a><span style=\"background: white;\">-produced&nbsp;</span><a href=\"https://www.allmusic.com/album/a-different-kind-of-fix-mw0002176740\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">A Different Kind of Fix</span></a><span style=\"background: white;\">. The plugged-in pop/rock approach was evident on the atmospheric dance-oriented leadoff single, \"Shuffle.\"</span></span></p>\r\n<p class=\"MsoNormal\" style=\"background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; background: white; mso-fareast-language: EN-GB;\">In 2014,&nbsp;</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\"><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;released the hypnotic&nbsp;</span><a href=\"https://www.allmusic.com/album/so-long-see-you-tomorrow-mw0002605687\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">So Long, See You Tomorrow</span></a><span style=\"background: white;\">, featuring songs influenced by&nbsp;</span><a href=\"https://www.allmusic.com/artist/steadman-mn0002111109\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Steadman</span></a><span style=\"background: white;\">\'s trip through Europe and India. The album reached number one on the Billboard Heatseekers Albums chart and number 14 on the Alternative Albums chart. Following a tour in support of the record, the group went on indefinite hiatus in 2016 to focus on personal projects. The following year,&nbsp;</span><a href=\"https://www.allmusic.com/artist/nash-mn0002521551\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Nash</span></a><span style=\"background: white;\">&nbsp;released the solo album&nbsp;</span><a href=\"https://www.allmusic.com/album/the-pace-of-the-passing-mw0003004106\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">The Pace of the Passing</span></a><span style=\"background: white;\">, under the name&nbsp;</span><a href=\"https://www.allmusic.com/artist/toothless-mn0003336436\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Toothless</span></a><span style=\"background: white;\">.&nbsp;</span><a href=\"https://www.allmusic.com/artist/steadman-mn0002111109\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Steadman</span></a><span style=\"background: white;\">&nbsp;also emerged with his own&nbsp;</span><a href=\"https://www.allmusic.com/artist/mr-jukes-mn0003609399\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Mr. Jukes</span></a><span style=\"background: white;\">&nbsp;project, issuing the LP&nbsp;</span><a href=\"https://www.allmusic.com/album/god-first-mw0003036860\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">God First</span></a><span style=\"background: white;\">.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; background: white; mso-fareast-language: EN-GB;\">The group eventually reunited, and in January 2020&nbsp;</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-GB;\"><a href=\"https://www.allmusic.com/artist/bombay-bicycle-club-mn0001055021\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Bombay Bicycle Club</span></a><span style=\"background: white;\">&nbsp;returned with their fifth studio album,&nbsp;</span><a href=\"https://www.allmusic.com/album/everything-else-has-gone-wrong-mw0003334671\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">Everything Else Has Gone Wrong</span></a><span style=\"background: white;\">, which included the single \"Eat, Sleep, Wake (Nothing But You).\"</span></span></p>\r\n<p><!--EndFragment--></p>', 'bombaybicycleclub_1581801807.jpg', 'https://bombaybicycle.club/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/3UTjfyD32Hw\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1003, 311, 2101);
