st-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p style=\"line-height: 16.6pt; margin: 0cm 0cm 18.0pt 0cm;\"><span style=\"font-family: \'Calibri\',sans-serif; color: #575d63;\">In an age when affectation is all too often mistook for integrity, Belfast-based four-piece Gascan Ruckus are living, pummelling proof that energy and intent far outweigh the laws of pretension and empty promises. Having formed in Armagh in 2008, the incomparably energetic quartet embody an ethos firmly rooted in riff-centric punk rock; one defined by pop sensibilities and a truly uncanny ear for a killer melody. Bursting with immediacy, infectious accessibility and countless unforgettable hooks throughout, the band&rsquo;s new EP, Buddies, is a pulsating, totally unrelenting distillation of what the band are all about.</span></p>\r\n<p style=\"line-height: 16.6pt; overflow-wrap: break-word; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px; margin: 0cm 0cm 18.0pt 0cm;\"><span style=\"font-family: \'Calibri\',sans-serif; color: #575d63;\">Having put out three brilliantly brawling singles and toured the UK twice in the last 18 months, the band have been quick to capitalise on their growing reputation on the local circuit and beyond, attracting comparisons to fellow riff masters general Kerbdog, The Bronx and local noiseniks LaFaro in the process. Now, with the release of Buddies, Gascan Ruckus&rsquo; raucous urgency boasts a melodic backbone like never before; the band&rsquo;s riff-driven throwdowns coalescing with snarling vocals to create a virtually unmistakable sound.</span></p>', 'gascanruckus_1581507183.jpg', 'https://gascanruckus.bandcamp.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/9ybs0jRDyHw\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1002, 349, 2106);
