r\n   Name=\"List Table 6 Colorful Accent 2\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 2\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Hyperlink\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Hashtag\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Unresolved Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Link\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">Stokes and Pearce originally met in high school, and met both Sinclair and Luketina-Johnston when all four attended classes at the&nbsp;<a title=\"University of Auckland\" href=\"https://en.wikipedia.org/wiki/University_of_Auckland\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">University of Auckland</span></a>, studying jazz. Prior to The Beths, Luketina-Johnston was performing&nbsp;<a title=\"Swing music\" href=\"https://en.wikipedia.org/wiki/Swing_music\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">swing</span></a>&nbsp;under the moniker of Sal Valentine. Stokes, Pearce and Sinclair were all a part of his backing band, The Babyshakes, for various tenures. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The Beths were formed in early 2015, and released their first single \"Idea/Intent\" via&nbsp;<a title=\"Soundcloud\" href=\"https://en.wikipedia.org/wiki/Soundcloud\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Soundcloud</span></a>&nbsp;in July of that year.&nbsp;In March 2016, the band independently released their debut EP,&nbsp;<em>Warm Blood</em>. The EP spawned a single, \"Whatever,\" which was released with an accompanying music video in May 2016. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">A new single, \"Great No One,\" was released in October 2017.&nbsp;The song was the first to be lifted from the band\'s debut album,&nbsp;<em>Future Me Hates Me</em>.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">Prior to the album\'s release in 2018, the bands announced their signing to&nbsp;<a title=\"Carpark Records\" href=\"https://en.wikipedia.org/wiki/Carpark_Records\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Carpark Records</span></a>&nbsp;in the US (who also reissued&nbsp;<em>Warm Blood</em>&nbsp;internationally)&nbsp;and to&nbsp;<a title=\"Dew Process\" href=\"https://en.wikipedia.org/wiki/Dew_Process\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Dew Process</span></a>&nbsp;in Australia.&nbsp;The album was released globally on 10 August 2018, followed by an international tour supporting the release. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The title track was nominated as one of five finalists for the 2018&nbsp;<a title=\"APRA Awards (New Zealand)\" href=\"https://en.wikipedia.org/wiki/APRA_Awards_(New_Zealand)#APRA_Silver_Scroll_Awards\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Silver Scroll</span></a>&nbsp;award in New Zealand. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">In 2018, Luketina-Johnston permanently departed from the band to focus on Sal Valentine.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">In November 2018, the band announced the forthcoming release of a new seven-inch,&nbsp;<em><a title=\"Have Yourself a Merry Little Christmas\" href=\"https://en.wikipedia.org/wiki/Have_Yourself_a_Merry_Little_Christmas\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Have Yourself a Merry Little Christmas</span></a></em>. The vinyl features the band\'s cover of the traditional title track, as well as a demo version of their song \"Happy Unhappy.&rdquo;&nbsp;\"Happy Unhappy\" was named 2018&nbsp;<em><a title=\"Rolling Stone\" href=\"https://en.wikipedia.org/wiki/Rolling_Stone\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Rolling Stone</span></a></em>&nbsp;magazine song of the summer. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">In early 2019, the band undertook a tour of the UK and Europe supporting&nbsp;<a title=\"Death Cab for Cutie\" href=\"https://en.wikipedia.org/wiki/Death_Cab_for_Cutie\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Death Cab for Cutie</span></a>. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">A new record is slated for release in 2020. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The band is known for its use of&nbsp;<a title=\"Vocal harmony\" href=\"https://en.wikipedia.org/wiki/Vocal_harmony\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">vocal harmony</span></a>, using the voices of all three band members. </span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The Beths have received financial support from the&nbsp;<a title=\"NZ on Air\" href=\"https://en.wikipedia.org/wiki/NZ_on_Air\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">NZ on Air</span></a>&nbsp;and&nbsp;<a title=\"New Zealand Music Commission\" href=\"https://en.wikipedia.org/wiki/New_Zealand_Music_Commission\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">NZ Music Commission</span></a>. In September 2015, the band received money to make the single and video for \"Whatever\" from NZ on Air. In May 2016, NZ on Air funded a video for \"Lying in the Sun\". Through their Outward Sound program, the NZ Music Commission funded three tours as part of their international music market development grants.</span></p>', 'thebeths_1581508835.jpg', 'https://thebeths.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/iVImwSb4EYU\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1006, 323, 2108);
INSERT INTO `BARTIST` (`pk_artist_id`, `name`, `intro`, `bio`, `image`, `url`, `video`, `fk_genre_id`, `fk_performance_id`, `fk_account_id`) VALUES
(676, 'Spanish Love Songs', 'When youre young, you just want to be heard, opines Dylan Slocum.', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">The singer and guitarist of LA-based punk quintet SPANISH LOVE SONGS is referencing his band, but he could just as easily be talking about himself. Since forming in 2014, Spanish Love Songs certainly have been heard, from legions of underground audiences at The Fest and South By Southwest to outlets like NPR, who hailed the group&rsquo;s 2018 album, Schmaltz, as a &ldquo;wellspring of big ideas, bigger riffs and the biggest possible feelings about love, war, fear and existential crisis.&rdquo;</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">Schmaltz was an album colored by guilt and self-doubt, an insular collection of soul- searching songs that found the singer amplifying his grief while kicking back at a world that seemed to be doing its best to keep knocking him down. It was a cathartic album, one that admittedly took a lot of Slocum&rsquo;s soul to create. (&ldquo;I don&rsquo;t want to be the band where each album is me complaining about myself for 40 minutes,&rdquo; he says.) </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">So instead, Slocum decided to look outward for Spanish Love Songs&rsquo;s third album, BRAVE FACES EVERYONE, due out February 7, 2020 on the band&rsquo;s new label, Pure Noise Records. Steeped in the same detail-rich storytelling of Bruce Springsteen, The Menzingers and Manchester Orchestra and filtered through the band&rsquo;s sweat-soaked punk fervor, the songs on BRAVE FACES EVERYONE represent the situations Slocum and his bandmates &mdash; guitarist Kyle McAulay, bassist Trevor Dietrich, drummer Ruben Duarte and keyboardist Meredith Van Woert &mdash; experienced during 30-some weeks of rigorous touring during the Schmaltz album cycle. </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">These are character stories set in small-town America and anxious urban jungles alike, unfurling heartbreaking tales of addiction, depression, debt and death juxtaposed alongside looming societal bogeys like mass shootings, the opioid epidemic and climate change. They&rsquo;re all at once personal vignettes and universal truths of life in the 2010s, the lines blurred between Slocum&rsquo;s own experiences and those of his friends and acquaintances. Because, as he sings in &ldquo;Beachfront Property,&rdquo; &ldquo;Every city&rsquo;s the same/Doom and gloom under different names.&rdquo; These are the things that affect us all. </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">But for all its emotional heft, Slocum doesn&rsquo;t see BRAVE FACES EVERYONE as a pessimistic album. Rather, the album &mdash; produced by McAulay at Howard Benson&rsquo;s West Valley Recording &mdash; seeks to find balance between realism and optimism. It implores us to harbor less judgment and more empathy, to talk less and listen more. To understand that life never goes off the rails all at once. Rather, it&rsquo;s a years-long series full of seemingly imperceptible events that snowball into life-altering issues like heroin addiction, mental illness or suicide. But just as things didn&rsquo;t break overnight, happiness and redemption aren&rsquo;t as simple as a flip of the switch. It&rsquo;s a day-by-day, step-by-step climb we have to work to attain. </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">Ultimately, BRACE FACES EVERYONE boldly declares that even though things might be bad, they&rsquo;re not hopeless. On the appropriately named &ldquo;Optimism,&rdquo; Slocum sings, &ldquo;Help me weather this high tide/But don&rsquo;t take me out back and shoot me,&rdquo; while the album-closing title track bears the album&rsquo;s central thesis: &ldquo;We were never broken/Life&rsquo;s just very long.&rdquo; </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; background: white;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: #4d4d4d; letter-spacing: .1pt; mso-fareast-language: EN-GB;\">Ultimately, Spanish Love Songs are trying to break through that pessimism however they can. Sometimes that&rsquo;s as simple as a hopeful lyric or soaring chorus to cut the tension in an otherwise weighty song, a brief respite that gives listeners a comforting melody to rally around. &ldquo;If you sing something loud enough and long enough,&rdquo; Slocum muses, &ldquo;hopefully people are able to find some peace in that.&rdquo; Experimenting with more traditional song structures and fewer forwardly caustic moments this time around haven&rsquo;t dulled the band&rsquo;s sound. If anything, they&rsquo;ve accentuated the most important parts of it. When everything is loud and urgent, nothing is. But when Slocum&rsquo;s voice swells to a roar on a song like &ldquo;Generation Loss,&rdquo; the undeniable power grabs you by the collar and forces you to pay attention &mdash; and that&rsquo;s the difference between simply being heard and truly being understood. XX</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', 'spanishlovesongs_1581509004.jpg', 'http://www.spanishlovesongs.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/HYbAW0JlwdQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1006, 359, 2109);
