rful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Hyperlink\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Hashtag\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Unresolved Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Link\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p class=\"MsoNormal\">Empty Lungs are a 4 piece based in Belfast, N. Ireland consisting of Kev Jones(lead vocal, guitar), Ryan Holmes(bass, vocal), Sam Chadwick(guitar, vocal).&nbsp; They played their first show in May 2011 they play passionate, anthemic and catchy music that draws influence from punk, folk, country and post-hardcore.&nbsp; The bands relentlessly energetic live shows have gained them a reputation as a must see act and within a few months of playing shows around Ireland they had already received attention from local media and received airplay on BBC Radio 1, Radio Ulster and countless podcasts.</p>\r\n<p class=\"MsoNormal\"><br />Their debut single &rdquo;Identity Lost&rdquo; was mixed by Rocky O&rsquo; Reilly (Opppenheimer, And so I watch you from afar) and was released on 20th September 2011.<span style=\"mso-spacerun: yes;\">&nbsp; </span>2012 has seen Empty Lungs enter the studio to record a 6 track EP that they&rsquo;re currently planning a release for, gain a 4th member in the shape of second guitarist Sam Chadwick and play a host of shows, including a full UK tour, supports with the likes of The Subways, General Fiasco, Cheap Girls, Lemuria, Franz Nicolay(The Hold Steady), Japandroids, Dead To Me and a appearance at one of the biggest independent festivals in Ireland Glasgowbury.<br style=\"mso-special-character: line-break;\" /><!-- [if !supportLineBreakNewLine]--><br style=\"mso-special-character: line-break;\" /><!--[endif]--></p>\r\n<p class=\"MsoNormal\"><strong>PRESS:</strong></p>\r\n<p class=\"MsoNormal\">This Belfast trio&rsquo;s debut triple-tracker will be catnip for anyone who worships at the altar of Hot Water Music, Jawbreaker and their Eighties and Nineties US punk brethren.&nbsp; It\'s all remarkably accomplished for a first release, but then Kev Jones and Ryan Holmes have paid their dues in various bands over the last five to 10 years, and it shows, this is an impressive opening salvo.</p>\r\n<p class=\"MsoNormal\"><em>- Chris Jones, AU Magazine.</em></p>\r\n<p class=\"MsoNormal\"><br />&rdquo;&hellip;The boys are in world beating form, they belt out the likes of &rdquo;Identity Lost&rdquo; and &rdquo;Nothing Left To Lose&rdquo; with a belief and passion that marks them out as one of the best unsigned acts on the island right now.&rdquo;</p>\r\n<p class=\"MsoNormal\"><em>&ndash; Edwin McFee, Hot Press Magazine.</em></p>\r\n<p class=\"MsoNormal\"><br />&ldquo;Empty Lungs are like a cross between our own Runnin\' Riot and New Jersey legends The Bouncing Souls, with an added pinch of Ted Leo clean guitar goodness. That, my friends, is no bad thing at all.&nbsp; <span style=\"font-size: 12pt;\">I can now heartily recommend the band as a potent power trio with a rapidly expanding set of catchy yet crunchy tuneage. Empty Lungs Rock\"</span></p>\r\n<p class=\"MsoNormal\"><em><span style=\"font-size: 12pt;\"> -David Roy, The Irish News.</span></em></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&ldquo;There&rsquo;s a refreshing lack of pretence, the band managing to rise above the sometimes &lsquo;whiney&rsquo; nature of this genre by steadfastly refusing to sing in an American accent&rsquo; There&rsquo;s a convincing racket delivered by the three piece, melodic and competently played. Some of the local buzz bands could definitely learn from Empty Lungs example</p>\r\n<p class=\"MsoNormal\"><em>&ndash; Shane Horan, BBC ATL.</em></p>\r\n<p class=\"MsoNormal\"><br />&ldquo;Identity Lost&rdquo; is a powerful piece of alternate-punk that exhibits an intelligence and musical virtuosity beyond what you would expect from the genre. Definitely a band worth watching. The band&rsquo;s sound carries echoes of 80\'s style American hardcore with traces of The Replacements very evident in their songs. However, they thankfully don&rsquo;t have any glossy 80&rsquo;s veneer running over them, but instead have an aggressive and a lyrical realism and sincerity that carries through the vocals and to the whole feel of the band as well. You know they mean every last note they play; the drums hit hard and tight and the basslines are syrup thick and just as sweet. By the time they&rsquo;re on their second track, Stand Up, I want to be down the front singing along with them. Everyone in the room are seemingly aware that they are seeing one of the best new acts around as people turn to me and ask again for the band&rsquo;s name, just so they remember it to look them up later. I suggest you dothe same; they could be your new favourite band.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p><!--EndFragment--></p>', 'emptylungs_1581718951.jpg', 'https://emptylungs.bandcamp.com/album/stand-up-ep', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lgyO65vesxs\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1006, 367, 2110);
