reast-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">Pocket Billiards&nbsp;are a Belfast-based 9-Piece&nbsp;<a title=\"Ska\" href=\"https://en.wikipedia.org/wiki/Ska\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Ska</span></a>&nbsp;/&nbsp;<a title=\"Punk rock\" href=\"https://en.wikipedia.org/wiki/Punk_rock\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Punk</span></a>&nbsp;/&nbsp;<a title=\"Rock music\" href=\"https://en.wikipedia.org/wiki/Rock_music\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Rock</span></a>&nbsp;band who originally formed in 2001. The band fuse ska,&nbsp;<a title=\"Reggae\" href=\"https://en.wikipedia.org/wiki/Reggae\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">reggae</span></a>&nbsp;and&nbsp;<a title=\"Dub music\" href=\"https://en.wikipedia.org/wiki/Dub_music\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">dub</span></a>&nbsp;with punk rock and heavy riffs, creating an energetic and powerful sound.<sup><a href=\"https://en.wikipedia.org/wiki/Pocket_Billiards_(band)#cite_note-Official_Website-1\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">[1]</span></a></sup></span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The band was formed in early 2001 by Chris Savage and Chuck Neely. Initially they got together to explore the sounds of ska with the goal of merging it with more modern styles of music to create a new sound. Within months of forming they had recruited a brass section, keyboard, drums and bass. The band\'s first ever gig was with Californian Ska Punk band&nbsp;<a title=\"Mad Caddies\" href=\"https://en.wikipedia.org/wiki/Mad_Caddies\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Mad Caddies</span></a>&nbsp;in&nbsp;<a title=\"The Limelight (Belfast)\" href=\"https://en.wikipedia.org/wiki/The_Limelight_(Belfast)\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">The Limelight (Belfast)</span></a>. By the end of 2002 the band had released their first 4 track demo \"Skandalous\".</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">The next few years saw several line-up changes and a steady climb in the band\'s popularity. They continued to get support slots performing with many of their idols including&nbsp;<a title=\"The Selecter\" href=\"https://en.wikipedia.org/wiki/The_Selecter\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">The Selecter</span></a>,&nbsp;<a title=\"Bad Manners\" href=\"https://en.wikipedia.org/wiki/Bad_Manners\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Bad Manners</span></a>&nbsp;and&nbsp;<a title=\"Neville Staples\" href=\"https://en.wikipedia.org/wiki/Neville_Staples\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Neville Staples</span></a>&nbsp;(<a title=\"The Specials\" href=\"https://en.wikipedia.org/wiki/The_Specials\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">The Specials</span></a>). In 2006 they made a DIY album using home recording equipment called \"Outlook Not So Good\", an&nbsp;<a title=\"Homage (arts)\" href=\"https://en.wikipedia.org/wiki/Homage_(arts)\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">homage</span></a>&nbsp;to the&nbsp;<a title=\"Magic 8-Ball\" href=\"https://en.wikipedia.org/wiki/Magic_8-Ball\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Magic 8-Ball</span></a>&nbsp;prediction.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">In October 2009 Pocket Billiards released their first full-length Studio Album (self-titled) at a sell-out show in the Black Box (<a title=\"Cathedral Quarter, Belfast\" href=\"https://en.wikipedia.org/wiki/Cathedral_Quarter,_Belfast\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Cathedral Quarter, Belfast</span></a>). They subsequently performed at several 2010 Festivals in&nbsp;<a title=\"Northern Ireland\" href=\"https://en.wikipedia.org/wiki/Northern_Ireland\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Northern Ireland</span></a>&nbsp;including Pigstock, Sunflower Festival and&nbsp;<a title=\"Glasgowbury\" href=\"https://en.wikipedia.org/wiki/Glasgowbury\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Glasgowbury</span></a>. In summer 2011 Pocket Billiards were invited to support&nbsp;<a title=\"The Specials\" href=\"https://en.wikipedia.org/wiki/The_Specials\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">The Specials</span></a>&nbsp;at Belfast\'s iconic&nbsp;<a title=\"Belsonic\" href=\"https://en.wikipedia.org/wiki/Belsonic\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Belsonic</span></a>&nbsp;Festival, a performance they were&nbsp;<em>\"pretty much born to play\"</em>.<sup><a href=\"https://en.wikipedia.org/wiki/Pocket_Billiards_(band)#cite_note-BBC_Across_The_Line-2\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">[2]</span></a></sup>&nbsp;In Autumn 2011 Pocket Billiards were nominated for \"Best Live Act\" in the first-ever Northern Ireland Music Awards<sup><a href=\"https://en.wikipedia.org/wiki/Pocket_Billiards_(band)#cite_note-AU_announce_NIMA_Nominations-3\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">[3]</span></a></sup>&nbsp;that took place at&nbsp;<a title=\"Ulster Hall\" href=\"https://en.wikipedia.org/wiki/Ulster_Hall\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Ulster Hall</span></a>, Belfast on 2 November.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; mso-color-alt: windowtext; mso-fareast-language: EN-GB;\">Pocket Billiards released their second studio album \"Last Chance to Dance\" at Belfast\'s&nbsp;<a title=\"Mandela Hall\" href=\"https://en.wikipedia.org/wiki/Mandela_Hall\"><span style=\"color: black; mso-color-alt: windowtext; text-decoration: none; text-underline: none;\">Mandela Hall</span></a> on May 12, 2012. In July 2012 they toured Luxembourg, France, Basque Country and Catalonia. The summer of 2012 also saw the band return to some of Northern Ireland\'s biggest festivals, playing main stage slots at Pigstock, Sunflower Fest and Glasgowbury.</span></p>', 'pocketbilliards_1581510267.jpg', 'https://pocketbilliards.bandcamp.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/_27T2lZdSm4\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1005, 347, 2111);
INSERT INTO `BARTIST` (`pk_artist_id`, `name`, `intro`, `bio`, `image`, `url`, `video`, `fk_genre_id`, `fk_performance_id`, `fk_account_id`) VALUES
(679, 'The Menzingers', '', '<p>The Menzingers formed in the wake of Scranton ska-punk/pop punk bands Bob and the Sagets (featuring Tom May, Joe Godino, Eric Keen, and non-Menzingers members Lee Hartney &amp; Curtis Irie, currently of Irie Idea) and Kos Mos (featuring Greg Barnett, Adam Mcilwee of Tigers Jaw and Wicca Phase Springs Eternal, and Leo Vergnetti of Captain, We\'re Sinking).</p>\r\n<p><br />Their first release was a self-titled demo tape made in 2006, which made its way onto many top ten lists of that year. &nbsp;Their debut full length, \"A Lesson in the Abuse of Information Technology\" (released on Go-Kart Records), was produced by Jesse Cannon. According to Cannon, \"I record bands every day and almost all of them are missing something. The Menzingers have it all &mdash; the songs, the aggression, the heart, and the passion that most only dream of.\" In 2009, the band released a four-song EP titled \"Hold On Dodge\" through Red Scare Industries, their first vinyl release (including a 600-run olive edition). &nbsp;A bonus track for the EP titled \"Kentucky Gentleman\" is available through iTunes. Early in 2010, the band did a brief stint with Anti-Flag. April 13 saw the release of their second full length, Chamberlain Waits, through Red Scare Records. <br />In March and April they also toured in support of Against Me!. On May 17, 2011, they announced that they had signed to Epitaph Records. Brett Gurewitz, founder of Epitaph Records and guitarist of Bad Religion said this about the signing of the band: \"These guys play the kind of pure punk rock that I grew up with. They are seriously talented songwriters and I\'m happy to welcome them to the Epitaph family. I think the band is a great fit here.\"They released On the Impossible Past on February 20, 2012, and it was met with critical acclaim. A music video was shot and released for the song \"Nice Things.\" On the Impossible Past went on to be voted \"Album Of The Year\" 2012 for both Absolutepunk.net and Punknews.org. It was also voted \"Album Of The Year\" by RockZone magazine in Spain. The Menzingers released a split 7\" EP with The Bouncing Souls in November 2013. Both bands released a new original song on the split, along with a cover of one of the other band\'s songs. The Menzingers covered \"Kate is Great\" from The Bouncing Souls, and The Bouncing Souls covered \"Burn After Writing\" from On the Impossible Past.</p>\r\n<p><br />On November 29, 2013, while performing at the Bowery Ballroom, Greg Barnett said that the band had just come out of the studio. The new album, Rented World, was released on April 22, 2014. A music video for a song from the new album, \"In Remission\", was released on February 18, 2014. The band spent 2014 and 2015 touring North America, Europe, and Australia with a variety of acts as both support and a headline act, including The Smith Street Band, Off With Their Heads, Lemuria, Chumped, Taking Back Sunday, mewithoutYou, Pianos Become the Teeth, letlive., and others. The Menzingers released their fifth studio album After The Party on February 3, 2017, for Epitaph Records, along with a United States tour featuring Jeff Rosenstock and Rozwell Kid. On May 30, 2018, The Menzingers released a new single: \"Toy Soldier\" and released \"The Freaks\" in October. &nbsp;The Menzingers announced their sixth studio album Hello Exile and premiered a music video for the single \"Anna\" on July 15, 2019. &nbsp;On August 20, 2019, The Menzingers released the second single from Hello Exile: \"America (You&rsquo;re Freaking Me Out)\", alongside a music video. On September 18, 2019, The Menzingers released the third single from Hello Exile: \"Strangers Forever\", alongside a music video. Hello Exile was released on October 4, 2019 on Epitaph Records and the band went on a U.S. headlining tour with Tigers Jaw and Culture Abuse.</p>', '94220A04-FB45-4958-91CF-1988914FB74F_1581854976.jpeg', 'https://themenzingers.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/4sV46Eo5J10\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1006, 316, 2116),
