xception Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Hyperlink\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Hashtag\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Unresolved Mention\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"Smart Link\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></p>\r\n<p style=\"margin: 0cm 0cm 12.0pt 0cm;\"><strong><span style=\"font-family: \'Calibri\',sans-serif; color: #353535;\">When:&nbsp;</span></strong><span style=\"font-family: \'Calibri\',sans-serif; color: #353535;\">Getting together last year, these all hail from the north coast of Northern Ireland. Apparently they bonded over a mutual love for It&rsquo;s Always Sunny In Philadelphia and early 00&rsquo;s sad boy punk. Their debut single &lsquo;Strong Forever&rsquo;, streaming above and recorded on Rathlin Island off the coast of Antrim, finds the band exploring a pop rock sound reminiscent of Alvvays and NME&rsquo;s legendary C86 compilation rather&nbsp;than the band members&rsquo; various histories in hardcore (Lantern for a Gale), punk (Vanilla Gloom), pop (The Salt Flats) and rap (Bee Mick See).</span></p>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; caret-color: #353535; color: #353535; font-family: Georgia, \'Times New Roman\', Times, serif; -webkit-text-size-adjust: 100%;\"><strong><span style=\"font-family: \'Calibri\',sans-serif; color: #353535;\">Why:&nbsp;</span></strong><span style=\"font-family: \'Calibri\',sans-serif; color: #353535;\">The guitars are fuzzy with a hint of jangle, the melody is bouncy and memorable, and Grace Loughrey&rsquo;s vocals are fairly exquisite. The track sounds so wonderfully effortless in that kind of way that is really, ironically, quite hard to pull off. The song also sports a deft use of dynamics that enables the song to carry an emotional heft without having to beat the listener across the head and face with heavy handed and over wrought emoting</span><span style=\"font-size: 10.5pt; font-family: \'Georgia\',serif; color: #353535;\">.</span></p>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; caret-color: #353535; color: #353535; font-family: Georgia, \'Times New Roman\', Times, serif; -webkit-text-size-adjust: 100%;\"><!--EndFragment--></p>', 'badfit_1582027119.jpg', 'https://en-gb.facebook.com/BadFitBand/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/_pjXONY_HCM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1000, 318, 2117),
(699, 'Slowthai', NULL, 'Tyron Kaymone Frampton (born 18 December 1994),[1] better known by his stage name Slowthai (stylised in lowercase), is a British rapper from Northampton.[2] He rose to popularity in 2019 for his gritty and rough instrumentals and raw, politically charged lyrics, especially around Brexit and Theresa Mays tenure as British Prime Minister. Slowthai placed 4th in the BBC Sound Of 2019 and followed up in the same year with his debut studio album, Nothing Great About Britain. The album was nominated for the Mercury Prize; at Slowthais 2019 Mercury Prize ceremony performance, he held a fake severed head of British Prime Minister Boris Johnson on stage, generating much controversy', 'ECD98F67-27AB-4469-8689-61FBAC55D8BF_1583451802.jpeg', 'https://www.slowthai.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/WZsNnuaUSNs\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1010, 371, 2167),
(700, 'Phil Kieran', NULL, 'Phil Kieran is a DJ, music producer and electronic music recording artist from Belfast, Northern Ireland.\r\n\r\nKieran is primarily a club DJ, making his name as the resident at Shine in Belfast and later playing at venues across the world. He plays a wide variety of music including techno, breaks and house. Kieran has released numerous 12\"s that have received recurring airtime on Radio 1 and featured on mix CDs by DJs such as Carl Cox, Pete Tong, Slam and on various Global Underground mixes such as Deep Dish\'s GU021. He Released his first album as Le Carousel in 2013. The Album is titled \'Carousel\'.\r\n\r\nHe has recorded for the DMC, Skint, Yoshitoshi and Shine labels. In 2002 he was awarded the Best Dance Act award at the BBC Hot Press awards.[1]\r\n\r\nIn 2005 he formed a band called Alloy Mental, a collaboration with Irish singer-songwriter Martin Corrigan. They released four 12\"s and followed this up with the June 2007 release of the album We Have Control. They also played a live set on Annie Mac\'s Radio 1 birthday show. Mac and Kieran became friends while working together at Shine in Belfast.[2]\r\n\r\nA set mixed by Kieran was featured on BBC\'s Essential Mix on 15 April 2007.[3]', 'philkieran_1583696220.jpg', 'http://www.philkieranmusic.com/', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ui_O6l_KkDE\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1004, NULL, 2169);

